import './App.css';

import React,{Component} from 'react';
//import data from './user/users_job.js';
import data from './user/users.js';



class Table extends Component{
  constructor(props){ 
    super(props);

    this.myUserList = data;
  };


  render(){
    return (
      <h1 className="n">{this.myUserList.map(user=>user.user_first_name)}</h1>
    )
  };

}


export default Table;
